
-- Table: ea
DROP TABLE IF EXISTS ea;
CREATE TABLE ea (
	id INTEGER NOT NULL, 
	record_id INTEGER, 
	continent VARCHAR(255), 
	status VARCHAR(255), 
	sporder VARCHAR(255), 
	family VARCHAR(255), 
	genus VARCHAR(255), 
	species VARCHAR(255), 
	log_mass_g FLOAT, 
	comb_mass_g FLOAT, 
	reference VARCHAR(255), 
	PRIMARY KEY (id)
);


